import { createSelector } from 'reselect';
import get from 'lodash/get';

const _getDataSet = state => state.dataSet;
export const getDataSet = createSelector(_getDataSet, dataSet => dataSet);

export const getDisplayedData = createSelector(getDataSet, dataSet => get(dataSet, 'displayedData', false));
export const getProductType = createSelector(getDataSet, dataSet => get(dataSet, 'productType', false));
export const getProductLine = createSelector(getDataSet, dataSet => get(dataSet, 'productLine', false));
export const getSortAttribute = createSelector(getDataSet, dataSet => get(dataSet, 'sortAttribute', false));
